import "testing"
import "fmt"

func nextGreaterElements(nums []int) []int {
	size := len(nums)
	retv := make([]int, size)
	for i := 0; i < size; i++ {
		retv[i] = -1
	}
	stack := make([]int, 2*size)
	slen := 0
	for i := 0; i < 2*size; i++ {
		idx := i % size
		val := nums[idx]
		for slen > 0 && nums[stack[slen-1]] < val {
			retv[stack[slen-1]] = val
			slen--
		}
		// fmt.Println(slen)
		stack[slen] = idx
		slen++
	}
	return retv
}

